import React from 'react'
import {SiGmail , SiGithub} from 'react-icons/si';
import {IoLogoLinkedin} from 'react-icons/io';
import {FaPhoneSquare} from 'react-icons/fa';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

export default function Contact() {
    return (
        <React.Fragment>
            <Row xs={2} md={3} lg={3} justify-content-center  align-items-center>
                <a href="#"><SiGmail className="contactImg"/></a>
                <a href="#"><IoLogoLinkedin className="contactImg"/></a>
                <a href="#"><SiGithub className="contactImg"/></a>
                <a href="tel:+91-8892646353"><FaPhoneSquare className="contactImg"/></a> 
            </Row>
        </React.Fragment>
    )
}
